import React from 'react';

const Header = () => {
    return (
        <nav class="navbar">
        
            <div class="logo">
                <a href="#accueil">PAPI</a>
            </div>
            <ul>
                <li><a  href="#propos">A Propos</a></li>
                <li><a  href="#aportofolio">Services</a></li>
                <li><a  href="#acontact">Contacts</a></li>
            </ul>

            <button class="navbar-toggle ">
                <span></span>
            </button>
        </nav>
    )

};

export default Header;
